import Link from 'next/link';

const recipeContainer = {
	display: 'inline-block',
	margin: '0.25%',
	padding: '0.25%',
	width: '32%',
	height: '10em',
	border: '1px solid black',
	'border-radius': '0.25em'
}

const Recipe = (props) => (
  <div style={recipeContainer}>
  	<h1>{props.title}</h1>
  	<Link href="/recipe/{props.link}">
  		<a>View</a>
  	</Link>
  </div>
);

export default function Recipes() {
  return (
    <div>
    	<Recipe title="BBQ Pork Mac & Cheese" link="1" />
    	<Recipe title="Chili" link="2" />
    	<Recipe title="German Potato Soup" link="3" />
    	<Recipe title="Salmon with Tomato & Lemon" link="4" />
    	<Recipe title="Sausage & Peppers" link="5" />
    	<Recipe title="Southwestern Quesadilla" link="6" />
    </div>
  );
};
